Programą „Mano kelionės“ naudokite, kol bėgate, važiuojate dviračiu, keliaujate pėsčiomis arba užsiimate kita lauko veikla; bus naudojamas telefono GPS jutiklis, padėsiantis įrašyti pasirinktą kelią. Programa taip pat kaups naudingą statistiką, tokią kaip laikas, greitis, atstumas ir aukštis virš jūros lygio. Visus šiuos duomenis galite peržiūrėti tiesiogiai arba išsaugoti ir peržiūrėti vėliau. Kol esate išvykę, galite žymėti svarbius tarpinius taškus ir girdėti automatinius balso pranešimus apie savo pažangą.

 „Mano kelionės“ gali įrašyti duomenis iš išorinių jutiklių:
 – „Zephyr Technology Consumer HxM Bluetooth“ širdies ritmo monitoriaus;
 – „Polar Bluetooth“ širdies ritmo monitoriaus;
 – ANT+ širdies ritmo monitoriaus (*);
 – SRM galios matuoklių, greičio ir ritmo jutiklių (*);
 – greitai bus galima naudoti daugiau jutiklių.

 * Kad būtų palaikoma ANT+ ir SRM, reikalingas su ANT+ suderinamas telefonas

 Programos „Mano kelionės“ maršruto duomenimis galima dalytis:
 – kaip GPX, KML, CSV arba TCX failu;
 – naudojant „Google“ žemėlapius, „Google“ duomenų tvarkymo lenteles arba „Google“ dokumentus;
 – per „Google+“, „Facebook“ arba „Twitter“.

 Kitos funkcijos:
 – įrašymas metriniais arba angliškaisiais vienetais (galima sukonfigūruoti meniu „Įrašymas“, kurį rasite srityje „Nustatymai“);
 – judėjimo peržiūra pagal greitį arba tempą (galima sukonfigūruoti meniu „Ekranas“, kurį rasite srityje „Nustatymai“).

 „Mano kelionės“ yra atvirojo kodo projektas, jei norite prisidėti, apsilankykite adresu:

 http://mytracks.googlecode.com
